#include <cmath>
#include <cstdio>
#include <vector>
#include <deque>
#include <map>
#include <iostream>
#include <algorithm>
using namespace std;


int main() {
    int n = 200000;
    //cin >> n;
    string S = "";
    //cin >> S;
    int l=-1, r=n;
    map<char,vector<int>> M;
    M['A'] = vector<int>(n,0);
    M['C'] = vector<int>(n,0);
    M['T'] = vector<int>(n,0);
    M['G'] = vector<int>(n,0);
    M[S[0]].at(0) = 1;
    for(int i = 1; i < n; ++i)
    {
        M['A'][i] = M['A'][i-1];
        M['C'][i] = M['C'][i-1];
        M['T'][i] = M['T'][i-1];
        M['G'][i] = M['G'][i-1];
        M[S[i]][i] += 1;
        //cout << "i=" << i << " S[i]=" << S[i] << " M[S[i]][i]=" << M[S[i]][i] << endl;
    }
    for(int i = 3; i < S.length(); i+=4)
    {
        if( (M['A'][i] == (i+1)/4) &&
            (M['C'][i] == (i+1)/4) &&
            (M['T'][i] == (i+1)/4) &&
            (M['G'][i] == (i+1)/4) )
            l = i;
    }
    for(int i = S.length()-5; i >= 0; i-=4)
    {
        if( (M['A'][n-1] - M['A'][i] == (n-1-i)/4) &&
            (M['C'][n-1] - M['C'][i] == (n-1-i)/4) &&
            (M['T'][n-1] - M['T'][i] == (n-1-i)/4) &&
            (M['G'][n-1] - M['G'][i] == (n-1-i)/4) )
            r = i+1;
    }
    /*
    cout << "M[A]=" << M['A'].back() << endl;
    cout << "M[A].siz=" << M['A'].size() << endl;
    cout << "M[C]=" << M['C'].back() << endl;
    cout << "M[G]=" << M['G'].back() << endl;
    cout << "M[T]=" << M['T'].back() << endl;
    */
    //cout << "s.len=" << S.length() << " l=" << l << " r=" << r << endl;
    char m1='A', m2 = 'C', n1 = 'T', n2 = 'G';
    if(M[m2][n-1] > M[m1][n-1]) swap(m1,m2);
    if(M[n1][n-1] > M[m1][n-1]) swap(n1,m1);
    if(M[n2][n-1] > M[m1][n-1]) swap(n2,m1);
    
    if(M[n1][n-1] > M[m2][n1]) swap(n1,m2);
    if(M[n2][n-1] > M[m2][n-1]) swap(n2,m2);
    int k1 = (M[m1][n-1] - n/4); 
    int k2 = (M[m2][n-1] - n/4);
    //cout << "m1=" << m1 << " k1=" << k1 << " m2=" << m2 << " k2=" << k2 << endl;
    if (k1 > 0 && k2 > 0)
    {
        cout << 1 << endl;
        int m1l, m2l, m1r, m2r, ret, e1=0, e2=0;
        deque<int> D1, D2;
        if(l >= 0)
        {
            m1l = M[m1][l];
            m2l = M[m2][l];
        }
        else
        {
            m1l = 0;
            m2l = 0;
        }
        
        for(int i = r-1; i > l; --i)
        {
            if(M[m1][i]-m1l >= k1 && M[m2][i]-m2l >= k2) r = i;
            else break;
            if(S[i] == m1) D1.push_back(i);
            else if(S[i] == m2) D2.push_back(i);
        }
        m1r = M[m1][r];
        m2r = M[m2][r];
        //cout << "l=" << l << " r=" << r << endl;
        for(int i = l; i < r; ++i)
        {
            if(m1r - M[m1][i] >= k1 && m2r - M[m2][i] >= k2)
            {
                l = i+1;
            }
            else break;
        }
        ret = r-l+1;
        //cout << "ret=" << ret << " l=" << l << " r=" << r << endl;
        //cout << "d1b=" << D1.back() << " d2b=" << D2.back() << endl;
        while(!D1.empty() && D1.back() <= r) D1.pop_back();
        while(!D2.empty() && D2.back() <= r) D2.pop_back();
        //cout << "d1b=" << D1.back() << " d2b=" << D2.back() << endl;
        while(1)
        {
            if(S[l] == m1 && !D1.empty())
            {
                r = D1.back();
                D1.pop_back();
                while(S[++l] != m1 && S[l] != m2);
                while(!D2.empty() && D2.back() <= r)
                {
                    D2.pop_back();
                    e2++;
                }
                while(e2 > 0 && S[l] != m1)
                {
                    if(S[l] == m2) e2--;
                    l++;
                }
                while(S[l] != m1 && S[l] != m2) l++;
                //cout << "m1" << " l=" << l << " S[l]=" << S[l] << " r=" << r << " S[r]=" << S[r] << endl;
                if(r-l+1 < ret) ret = r-l+1;
            }
            else if(S[l] == m2 && !D2.empty())
            {
                r = D2.back();
                D2.pop_back();
                //cout << "d1b=" << D1.back() << endl;
                while(S[++l] != m1 && S[l] != m2);
                while(!D1.empty() && D1.back() <= r)
                {
                    D1.pop_back();
                    e1++;
                }
                while(e1 > 0 && S[l] != m2)
                {
                    if(S[l] == m1) e1--;
                    l++;
                }
                while(S[l] != m1 && S[l] != m2) l++;
                //cout << "m2" << " l=" << l << " S[l]=" << S[l] << " r=" << r << " S[r]=" << S[r] << endl;
                if(r-l+1 < ret) ret = r-l+1;
            }
            else break;
            //cout << ret << ' ' << l << ' ' << r << endl;
        }
        while(e1 > 0 || e2 > 0)
        {
            if(e1 > 0 && S[l] == m1)
            {
                e1--;
                while(S[++l] != m1 && S[l] != m2);
            }
            if(e2 > 0 && S[l] == m2)
            {
                e2--;
                while(S[++l] != m1 && S[l] != m2);
            }
            if((e1 == 0 && S[l] == m1) || (e2 == 0 && S[l] == m2)) break;
        }
        if(r-l+1 < ret) ret = r-l+1;
        cout << ret;
    }
    else if (k1 > 0)
    {
        cout << 2 << endl;
        deque<int> D1;
        int m1l, ret;
        if(l >= 0)
        {
            m1l = M[m1][l];
        }
        else
        {
            m1l = 0;
        }
        for(int i = r-1; i > l; --i)
        {
            if(M[m1][i]-m1l >= k1) r = i;
            else break;
            if(S[i] == m1) D1.push_back(i);
        }
        for(int i = l+1; i < r; ++i)
        {
            if(S[i] == m1)
            {
                l = i;
                break;
            }
        }
        ret = r-l+1;
        if(!D1.empty()) D1.pop_back();
        while(!D1.empty())
        {
            r = D1.back();
            D1.pop_back();
            while(S[++l] != m1);
            if(r-l+1 < ret) ret = r-l+1;
        }
        cout << ret;
    }
    else cout << 0;
    return 0;
}

